import axios from 'axios';
import { useEffect, useState } from 'react';
import { MainContainer, RowDiv } from '../styles/StyledStore';
/**
 * # QuestionList
 *
 * ## init
 *
 * @KimTank
 *
 * ## modified
 *
 * @TODO
 *
 * ## description
 *
 * - 질문 리스트
 * - nested route(중첩 라우트로 목록눌렀을 때 상세로 이동)
 *
 * @returns QuestionList
 */
function Temp() {
  const [data, setData] = useState([]);

  useEffect(() => {
    axios
      .get('/board/posts', {
        withCredentials: true,
        params: {
          page: 1,
          size: 10,
        },
      })
      .then((response) => {
        const { data } = response;
        console.log(data.data);
        setData(data.data);
      })
      .catch((error) => alert(error));
  }, []);

  return (
    <MainContainer>
      <ul>
        {data.length === 0 ? (
          <li>not empty</li>
        ) : (
          data.map((data) => (
            <li key={data.id}>
              <RowDiv>
                <div>Title: {data.title}</div>
                <div>{data.createdAt}</div>
                <div>Like</div>
              </RowDiv>
              <div></div>
            </li>
          ))
        )}
      </ul>
    </MainContainer>
  );
}

export default Temp;
